  const customers = Object.keys(props.customers).map(keys => {
    <tr>
      <td>Test</td>
      <td>Test</td>
      <td>Test</td>
    </tr>;
  });

  return (
    <>
      <div className={classes.container}>
        <h1>Customers</h1>
      </div>

      <div className={classes.container}>
        <table>
          <tbody>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
            </tr>
            <tr>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
            </tr>
          </tbody>
        </table>
      </div>
    </>
  );
};

export default CustomerList;
